            ':hover': {
                backgroundColor: 'lightgreen',
                color: 'black'
            }
        };
        return (

            <div className="container" style={style}>

            <form name="pageOne" method="post" onsubmit="return greeting()">
            <input type="submit" value="political" />
            </form>
            </div>
            );
    }
}

